import React from "react";

function Skills() {
  return (
    <section>
      <h2>Skills</h2>
      <ul>
        <li>HTML, CSS, Bootstrap, Ruby on Rails, GitLab</li>
        <li>ERP Tools: Odoo, ClickUp, Jira, Trello</li>
        <li>Agile, Scrum, SDLC</li>
        <li>Budgeting, Financial Reporting, Data Analysis</li>
        <li>Stakeholder Management, Leadership, Communication</li>
      </ul>
    </section>
  );
}

export default Skills;
